void printChatTable(int *a) {
    printf(" ++++++++ \n");
    for (int i = 0; i < 26; i++)
        printf(" %c - %d\n ", i + 'a', a[i]);
}

int lengthOfLongestSubstring(char* s) {
    int char_sz = 256;
    long char_table[ 256 ] = { -1 };
    for (int i = 0; i < char_sz; i++) char_table[ i ] = -1;
    long length = 0;
    long index = 0;
    long str_len = strlen( s );

    while (index < str_len) {
        int key = s[index];;
        int old_index = char_table[ key ];
        if (old_index >= 0) {
            for (int i = 0; i < char_sz; i++) {
                if (char_table[ i ] < old_index)
                    char_table[ i ] = -1;
            }

        }
        char_table[ key ] = index;

        int temp_length = 0;
        for (int i = 0; i < char_sz; i++) {
            if (char_table[i] >= 0)
                temp_length++;
           }
          if (temp_length > length)
                length = temp_length;
        index++;
    }
    printf(" String %s max length = %ld\n", s, length);
    return length;
}



